pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract TokenSale is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    IERC20 public token;
    uint256 public rate; // Number of tokens per ETH
    uint256 public minPurchaseETH;
    uint256 public maxPurchaseETH;
    uint256 public saleStart;
    uint256 public saleEnd;
    uint256 public totalTokensForSale;
    uint256 public tokensSold;
    bool public isSaleActive;

    mapping(address => uint256) public contributions;

    event TokensPurchased(address indexed buyer, uint256 amountETH, uint256 amountTokens);
    event SaleExtended(uint256 newEndTime);
    event SalePaused();
    event SaleResumed();
    event TokensWithdrawn(uint256 amount);

    constructor(
        IERC20 _token,
        uint256 _rate,
        uint256 _minPurchaseETH,
        uint256 _maxPurchaseETH,
        uint256 _saleStart,
        uint256 _saleEnd,
        uint256 _totalTokensForSale
    ) {
        require(_token != IERC20(address(0)), "Token address cannot be zero");
        require(_rate > 0, "Rate must be greater than zero");
        require(_minPurchaseETH > 0, "Min purchase must be greater than zero");
        require(_maxPurchaseETH > _minPurchaseETH, "Max purchase must be greater than min purchase");
        require(_saleStart < _saleEnd, "Sale start time must be before end time");
        require(_totalTokensForSale > 0, "Total tokens for sale must be greater than zero");

        token = _token;
        rate = _rate;
        minPurchaseETH = _minPurchaseETH;
        maxPurchaseETH = _maxPurchaseETH;
        saleStart = _saleStart;
        saleEnd = _saleEnd;
        totalTokensForSale = _totalTokensForSale;
        tokensSold = 0;
        isSaleActive = true;
    }

    modifier onlyWhileSaleActive() {
        require(isSaleActive, "Sale is not active");
        require(block.timestamp >= saleStart, "Sale has not started");
        require(block.timestamp <= saleEnd, "Sale has ended");
        _;
    }

    function buyTokens() external payable onlyWhileSaleActive {
        require(msg.value >= minPurchaseETH, "ETH sent is less than minimum purchase");
        require(msg.value <= maxPurchaseETH, "ETH sent exceeds maximum purchase");
        require(contributions[msg.sender].add(msg.value) <= maxPurchaseETH, "Total purchase exceeds maximum allowed");

        uint256 tokensToBuy = msg.value.mul(rate);
        require(tokensSold.add(tokensToBuy) <= totalTokensForSale, "Not enough tokens left for sale");

        contributions[msg.sender] = contributions[msg.sender].add(msg.value);
        tokensSold = tokensSold.add(tokensToBuy);

        token.safeTransfer(msg.sender, tokensToBuy);
        emit TokensPurchased(msg.sender, msg.value, tokensToBuy);
    }

    function extendSale(uint256 newEndTime) external onlyOwner {
        require(newEndTime > saleEnd, "New end time must be after current end time");
        saleEnd = newEndTime;
        emit SaleExtended(newEndTime);
    }

    function pauseSale() external onlyOwner {
        require(isSaleActive, "Sale is already paused");
        isSaleActive = false;
        emit SalePaused();
    }

    function resumeSale() external onlyOwner {
        require(!isSaleActive, "Sale is already active");
        isSaleActive = true;
        emit SaleResumed();
    }

    function withdrawETH() external onlyOwner {
        require(block.timestamp > saleEnd, "Sale has not ended yet");
        payable(owner()).transfer(address(this).balance);
    }

    function withdrawUnsoldTokens() external onlyOwner {
        require(block.timestamp > saleEnd, "Sale has not ended yet");
        uint256 unsoldTokens = totalTokensForSale.sub(tokensSold);
        require(unsoldTokens > 0, "No unsold tokens");
        token.safeTransfer(owner(), unsoldTokens);
        emit TokensWithdrawn(unsoldTokens);
    }

    function setRate(uint256 newRate) external onlyOwner {
        require(newRate > 0, "Rate must be greater than zero");
        rate = newRate;
    }

    function setMinMaxPurchase(uint256 newMin, uint256 newMax) external onlyOwner {
        require(newMin > 0, "Min purchase must be greater than zero");
        require(newMax > newMin, "Max purchase must be greater than min purchase");
        minPurchaseETH = newMin;
        maxPurchaseETH = newMax;
    }

    receive() external payable {
        buyTokens();
    }
}
