        // Transfer tokens to beneficiary
        token.safeTransfer(beneficiary, tokens);

        // Emit event
        emit TokensPurchased(msg.sender, beneficiary, weiAmount, tokens);

        // Forward funds to wallet
        wallet.transfer(weiAmount);
