local Clockwork = Clockwork;
local IsValid = IsValid;
local pairs = pairs;
local ScrH = ScrH;
local ScrW = ScrW;
local string = string;
local vgui = vgui;

local PANEL = {};

-- Called when the panel is initialized.
function PANEL:Init()
	self:SetSize(Clockwork.menu:GetWidth(), Clockwork.menu:GetHeight());

	self.panelList = vgui.Create("cwPanelList", self);
 	self.panelList:SetPadding(8);
 	self.panelList:SetSpacing(8);
 	self.panelList:SizeToContents();
	self.panelList:EnableVerticalScrollbar();

	self:Rebuild();
end;

-- A function to rebuild the panel.
function PANEL:Rebuild()
	self.panelList:Clear();

	local availableClasses = {};
	local classes = {};

	for k, v in pairs(Clockwork.class:GetAll()) do
		if (Clockwork.class:HasAccess(v.uniqueID)) then
			availableClasses[#availableClasses + 1] = v;
		end;
	end;

	table.sort(availableClasses, function(a, b)
		return a.name < b.name;
	end);

	for k, v in pairs(availableClasses) do
		local classForm = vgui.Create("cwClassForm", self);

		classForm:SetModel(v.model);
		classForm:SetClassTable(v);
		classForm:SetDescription(v.description);

		if (Clockwork.class:IsClass(v.uniqueID)) then
			classForm:SetSelected(true);
		end;

		self.panelList:AddItem(classForm);
	end;

	self.panelList:InvalidateLayout(true);
end;

-- Called when the panel should be painted.
function PANEL:Paint(w, h)
	DERMA_SLICED_BG:Draw(0, 0, w, h, 8, COLOR_WHITE);

	return true;
end;

-- Called when the layout should be performed.
function PANEL:PerformLayout(w, h)
	self.panelList:StretchToParent(0, 0, 0, 0);
end;

-- Called when the panel is selected.
function PANEL:OnSelected() self:Rebuild(); end;

-- Called when the panel is deselected.
function PANEL:OnDeselected() end;

