// 使用贪心算法
// 每次选择最小的两个数，然后合并
// 直到最后只剩一个数
// 每次合并的代价是这两个数的和
// 总代价是每次合并的代价之和
// 使用最小堆（优先队列）来实现
// 时间复杂度：O(nlogn)
// 空间复杂度：O(n)
class Solution {
public:
    int connectSticks(vector<int>& sticks) {
        if (sticks.size() <= 1) return 0;
        priority_queue<int, vector<int>, greater<int>> pq;
        for (int stick : sticks)
            pq.push(stick);

        int res = 0;
        while (pq.size() > 1) {
            int a = pq.top(); pq.pop();
            int b = pq.top(); pq.pop();
            int sum = a + b;
            res += sum;
            pq.push(sum);
        }
        return res;
    }
};

