极简主义风格，强调简洁、清晰和功能性。避免不必要的装饰，专注于核心内容。

设计原则：
1. 留白：使用大量留白，让内容呼吸，减少视觉混乱。
2. 限制颜色：使用单色或有限的配色方案，通常以黑白灰为主，偶尔使用一种强调色。
3. 清晰的排版：选择易读的字体，保持一致的字体大小和行距，使用层次结构（标题、副标题、正文）来组织内容。
4. 功能优先：每个元素都有明确的目的，去除任何不增加价值的装饰。
5. 高质量材料：在物理产品中，注重材质和工艺，展现简约而不简单的质感。

应用场景：
- 平面设计：海报、名片、书籍装帧
- 用户界面：网站、应用程序
- 室内设计：家居、办公空间
- 产品设计：家具、电子产品
- 时尚：服装、配饰

代表设计师/品牌：
- Dieter Rams（博朗设计师）
- Apple 产品设计
- 无印良品（MUJI）
- 建筑师：密斯·凡德罗（"少即是多"）、安藤忠雄

注意事项：
- 极简不等于简陋：需要精心设计才能达到简约而富有美感的效果。
- 易用性：在追求简洁的同时不能牺牲功能性。
- 文化差异：不同文化对"简约"的理解可能不同。

发展趋势：
随着数字时代的注意力稀缺，极简主义在UI设计和生活方式领域持续流行，同时与可持续设计理念结合（减少浪费，注重持久性）。
