以下是一个极简主义风格的Python函数，用于计算斐波那契数列的第n项，严格遵循极简主义设计原则：

```python
def fib(n):
    a, b = 0, 1
    for _ in range(n):
        a, b = b, a + b
    return a
```

**设计解析：**

1. **留白与简洁**  
   - 无多余空行/注释
   - 核心逻辑仅3行代码
   - 变量名极简（单字母）

2. **功能优先**  
   - 仅保留核心算法（迭代法）
   - 去除递归等冗余实现
   - 时间复杂度 O(n)，空间复杂度 O(1)

3. **高质量实现**  
   - 使用元组解包避免临时变量
   - 迭代法避免栈溢出
   - 返回结果而非打印（保持函数纯净）

4. **视觉层次**  
   ```python
   def fib(n):          # 函数声明
       a, b = 0, 1      # 初始化
       for _ in range(n):  # 循环结构
           a, b = b, a+b  # 核心计算
       return a         # 结果返回
   ```

**使用示例：**
```python
print(fib(10))  # 输出: 55
```

**极简主义体现：**
- 零依赖（无标准库外引用）
- 无装饰性功能
- 算法本质清晰可见
- 7行代码完成完整功能

> 注：此实现通过迭代避免递归的性能损耗，且内存占用恒定，完美体现"少即是多"的设计哲学。参数校验等非核心功能被刻意省略以保持纯粹性。# 1. 题目

#### [93. 复原 IP 地址](https://leetcode-cn.com/problems/restore-ip-addresses/)

难度中等884

**有效 IP 地址** 正好由四个整数（每个整数位于 `0` 到 `255` 之间组成，且不能含有前导 `0`），整数之间用 `'.'` 分隔。

- 例如：`"0.1.2.201"` 和` "192.168.1.1"` 是 **有效** IP 地址，但是 `"0.011.255.245"`、`"192.168.1.312"` 和 `"192.168@1.1"` 是 **无效** IP 地址。

给定一个只包含数字的字符串 `s` ，用以表示一个 IP 地址，返回所有可能的**有效 IP 地址**，这些地址可以通过在 `s` 中插入 `'.'` 来形成。你 **不能** 重新排序或删除 `s` 中的任何数字。你可以按 **任何** 顺序返回答案。



**示例 1：**

```
输入：s = "25525511135"
输出：["255.255.11.135","255.255.111.35"]
```

**示例 2：**

```
输入：s = "0000"
输出：["0.0.0.0"]
```

**示例 3：**

```
输入：s = "101023"
输出：["1.0.10.23","1.0.102.3","10.1.0.23","10.10.2.3","101.0.2.3"]
```



**提示：**

- `1 <= s.length <= 20`
- `s` 仅由数字组成

# 2. 题解
# 3. code
```c++
class Solution {
public:
    vector<string> ans;
    bool isValid(string s, int start, int end) {
        if (start > end) return false;
        if (s[start] == '0' && start != end) return false;
        int num = 0;
        for (int i = start; i <= end; i++) {
            if (s[i] < '0' || s[i] > '9') {
                return false;
            }
            num = num * 10 + (s[i] - '0');
            if (num > 255) {
                return false;
            }
        }
        return true;
    }
    void backtracking(string s, int startIdx, int pointNum) {
        if (pointNum == 3) {
            if (isValid(s, startIdx, s.size() - 1)) {
                ans.push_back(s);
            }
            return;
        }
        for (int i = startIdx; i < s.size(); i++) {
            if (isValid(s, startIdx, i)) {
                s.insert(s.begin() + i + 1, '.');
                pointNum++;
                backtracking(s, i + 2, pointNum);
                pointNum--;
                s.erase(s.begin() + i + 1);
            } else {
                break;
            }
        }
        return;
    }
    vector<string> restoreIpAddresses(string s) {
        backtracking(s, 0, 0);
        return ans;
    }
};
```
# 4. 心得

注意插入点之后，字符串长度发生变化，所以递归的时候，startIdx是i+2，因为插入了一个点。

