# Matplotlib 简介

Matplotlib 是一个用于数据可视化的 Python 库。它非常用户友好，并且提供了大量的绘图技术。Seaborn 是另一个基于 Matplotlib 的 Python 库。它提供了一个高级界面，用于绘制有吸引力的统计图形。

让我们导入必要的库。

```
import numpy as np
import pandas as pd
import matplotlib.pyplot as plt
import seaborn as sns
%matplotlib inline
```

# 线形图

线图用于表示连续数据。它用于确定一段时间内的趋势。

让我们创建一个线图。

```
x = np.linspace(1,10,100)
y = np.sin(x)
plt.plot(x,y)
```

![](img/0a4a0a0b0a0a0a0a0a0a0a0a0a0a0a0a.png)

作者图片

我们可以使用`plt.title()`、`plt.xlabel()`、`plt.ylabel()`等功能为剧情添加标题和标签。

```
plt.plot(x,y)
plt.title('Sine Wave')
plt.xlabel('x')
plt.ylabel('sin(x)')
```

![](img/0a4a0a0b0a0a0a0a0a0a0a0a0a0a0a0a.png)

作者图片

我们可以使用`plt.figure()`功能改变图形的大小。

```
plt.figure(figsize=(10,5))
plt.plot(x,y)
plt.title('Sine Wave')
plt.xlabel('x')
plt.ylabel('sin(x)')
```

![](img/0a4a0a0b0a0a0a0a0a0a0a0a0a0a0a0a.png)

