我们可以使用`plt.plot()`功能中的`color`参数改变线条的颜色。

```
plt.figure(figsize=(10,5))
plt.plot(x,y, color='red')
plt.title('Sine Wave')
plt.xlabel('x')
plt.ylabel('sin(x)')
```

![](img/0a4a0a0b0a0a0a0a0a0a0a0a0a0a0a0a.png)

