use std::collections::HashMap;

pub fn solve(input: &str) -> Option<HashMap<char, u8>> {
    let mut solver = AlphameticsSolver::new(input);
    solver.solve()
}

struct AlphameticsSolver {
    equation: String,
    letters: Vec<char>,
    leading_letters: Vec<char>,
    digit_used: [bool; 10],
    solution: HashMap<char, u8>,
}

impl AlphameticsSolver {
    fn new(equation: &str) -> Self {
        let mut letters: Vec<char> = equation
            .chars()
            .filter(|c| c.is_ascii_uppercase())
            .collect();
        letters.sort();
        letters.dedup();

        let mut leading_letters = vec![];
        for word in equation.split_whitespace().filter(|word| word.len() > 1) {
            if let Some(c) = word.chars().next() {
                if c.is_ascii_uppercase() && !leading_letters.contains(&c) {
                    leading_letters.push(c);
                }
            }
        }

        AlphameticsSolver {
            equation: equation.to_string(),
            letters,
            leading_letters,
            digit_used: [false; 10],
            solution: HashMap::new(),
        }
    }

    fn solve(&mut self) -> Option<HashMap<char, u8>> {
        if self.letters.is_empty() {
            return None;
        }

        if self.solve_letter(0) {
            Some(self.solution.clone())
        } else {
            None
        }
    }

    fn solve_letter(&mut self, index: usize) -> bool {
        if index == self.letters.len() {
            return self.verify();
        }

        let letter = self.letters[index];
        let start = if self.leading_letters.contains(&letter) {
            1
        } else {
            0
        };

        for digit in start..=9 {
            if self.digit_used[digit as usize] {
                continue;
            }

            self.solution.insert(letter, digit as u8);
            self.digit_used[digit as usize] = true;

            if self.solve_letter(index + 1) {
                return true;
            }

            self.digit_used[digit as usize] = false;
        }

        false
    }

    fn verify(&self) -> bool {
        let equation = self.equation.replace(|c: char| c.is_alphabetic(), |c: &str| {
            let ch = c.chars().next().unwrap();
            self.solution.get(&ch).unwrap().to_string()
        });

        let parts: Vec<&str> = equation.split("==").collect();
        if parts.len() != 2 {
            return false;
        }

        let left: Vec<&str> = parts[0].split('+').map(|s| s.trim()).collect();
        let right = parts[1].trim();

        let left_sum: u64 = left.iter().map(|s| s.parse::<u64>().unwrap()).sum();
        let right_sum: u64 = right.parse().unwrap();

        left_sum == right_sum
    }
}
use std::collections::HashMap;

pub fn solve(input: &str) -> Option<HashMap<char, u8>> {
    let mut solver = Solver::new(input);
    solver.solve(0, 0, 0)
}

struct Solver {
    input: String,
    chars: Vec<char>,
    first_chars: Vec<char>,
    solution: HashMap<char, u8>,
    digit_used: [bool; 10],
}

impl Solver {
    fn new(input: &str) -> Self {
        let mut chars: Vec<char> = input
            .chars()
            .filter(|c| c.is_ascii_uppercase())
            .collect();
        chars.sort();
        chars.dedup();

        let mut first_chars = vec![];
        for word in input.split_whitespace() {
            if let Some(c) = word.chars().next() {
                if c.is_ascii_uppercase() && !first_chars.contains(&c) {
                    first_chars.push(c);
                }
            }
        }

        Solver {
            input: input.to_string(),
            chars,
            first_chars,
            solution: HashMap::new(),
            digit_used: [false; 10],
        }
    }

    fn solve(
        &mut self,
        char_index: usize,
        left_sum: u64,
        right_sum: u64,
    ) -> Option<HashMap<char, u8>> {
        if char_index == self.chars.len() {
            if left_sum == right_sum {
                return Some(self.solution.clone());
            }
            return None;
        }

        let letter = self.chars[char_index];
        let start = if self.first_chars.contains(&letter) {
            1
        } else {
            0
        };

        for digit in start..=9 {
            if self.digit_used[digit as usize] {
                continue;
            }

            self.solution.insert(letter, digit as u8);
            self.digit_used[digit as usize] = true;

            let new_left_sum = self.calculate_left_sum();
            let new_right_sum = self.calculate_right_sum();

            if let Some(solution) = self.solve(char_index + 1, new_left_sum, new_right_sum) {
                return Some(solution);
            }

            self.digit_used[digit as usize] = false;
            self.solution.remove(&letter);
        }

        None
    }

    fn calculate_left_sum(&self) -> u64 {
        let equation = self.input.split("==").next().unwrap();
        equation
            .split('+')
            .map(|word| self.word_to_number(word.trim()))
            .sum()
    }

    fn calculate_right_sum(&self) -> u64 {
        let equation = self.input.split("==").nth(1).unwrap();
        self.word_to_number(equation.trim())
    }

    fn word_to_number(&self, word: &str) -> u64 {
        word.chars()
            .filter_map(|c| self.solution.get(&c))
            .fold(0, |acc, &digit| acc * 10 + digit as u64)
    }
}
