# 1. Introduction

The problem involves finding the number of distinct subsequences in a given string `s` that match a given string `t`. A subsequence is derived by deleting zero or more characters without changing the order of the remaining characters.

# 2. Intuition

The problem can be approached using dynamic programming. The key idea is to build a DP table where `dp[i][j]` represents the number of distinct subsequences of `s[0:i]` that equals `t[0:j]`.

# 3. Approach

1. **Initialization**: Create a DP table with dimensions `(len(s)+1) x (len(t)+1)`. Initialize the first row (except `dp[0][0]`) to 0 because an empty string `s` cannot form a non-empty `t`. Initialize the first column to 1 because an empty string `t` can be formed by any subsequence of `s` (by deleting all characters).

2. **DP Table Population**:
   - For each character in `s` (from 1 to len(s)):
     - For each character in `t` (from 1 to len(t)):
       - If the current characters in `s` and `t` match (`s[i-1] == t[j-1]`), then the number of subsequences is the sum of:
         - The number of subsequences without including this match (i.e., `dp[i-1][j]`).
         - The number of subsequences that include this match (i.e., `dp[i-1][j-1]`).
       - If they don't match, then the number is the same as excluding the current character in `s` (i.e., `dp[i-1][j]`).

3. **Result**: The value `dp[len(s)][len(t)]` gives the number of distinct subsequences.

# 4. Complexity Analysis

- **Time Complexity**: O(m*n), where `m` is the length of `s` and `n` is the length of `t`. This is because we fill a table of size `(m+1) x (n+1)`.
- **Space Complexity**: O(m*n) for the DP table. This can be optimized to O(n) by using a 1D DP array.

# 5. Code

```python
class Solution:
    def numDistinct(self, s: str, t: str) -> int:
        m, n = len(s), len(t)
        dp = [[0] * (n+1) for _ in range(m+1)]

        for i in range(m+1):
            dp[i][0] = 1

        for i in range(1, m+1):
            for j in range(1, n+1):
                if s[i-1] == t[j-1]:
                    dp[i][j] = dp[i-1][j] + dp[i-1][j-1]
                else:
                    dp[i][j] = dp[i-1][j]

        return dp[m][n]
```

# 6. Optimization

To optimize space, we can use a 1D DP array since each row only depends on the previous row.

```python
class Solution:
    def numDistinct(self, s: str, t: str) -> int:
        m, n = len(s), len(t)
        dp = [0] * (n+1)
        dp[0] = 1

        for i in range(1, m+1):
            # Traverse backwards to avoid overwriting values needed for the next calculation
            prev = dp[0]  # dp[0] is always 1 for the empty subsequence
            for j in range(1, n+1):
                temp = dp[j]
                if s[i-1] == t[j-1]:
                    dp[j] += prev
                prev = temp

        return dp[n]
```

In the optimized version:
- We maintain a 1D array `dp` where `dp[j]` represents the number of distinct subsequences for `t[0:j]` using the current prefix of `s`.
- We use a temporary variable `prev` to store the value of `dp[j-1]` from the previous iteration (which corresponds to `dp[i-1][j-1]` in the 2D version).
- We update `dp[j]` only when characters match by adding `prev` (which is `dp[i-1][j-1]`) to the current `dp[j]` (which is `dp[i-1][j]`). If they don't match, we leave `dp[j]` unchanged (which implicitly holds `dp[i-1][j]`).

This reduces the space complexity to O(n).# 1. 题目

#### [93. 复原 IP 地址](https://leetcode-cn.com/problems/restore-ip-addresses/)

难度中等856

**有效 IP 地址** 正好由四个整数（每个整数位于 `0` 到 `255` 之间组成，且不能含有前导 `0`），整数之间用 `'.'` 分隔。

- 例如：`"0.1.2.201"` 和` "192.168.1.1"` 是 **有效** IP 地址，但是 `"0.011.255.245"`、`"192.168.1.312"` 和 `"192.168@1.1"` 是 **无效** IP 地址。

给定一个只包含数字的字符串 `s` ，用以表示一个 IP 地址，返回所有可能的**有效 IP 地址**，这些地址可以通过在 `s` 中插入 `'.'` 来形成。你 **不能** 重新排序或删除 `s` 中的任何数字。你可以按 **任何** 顺序返回答案。



**示例 1：**

```
输入：s = "25525511135"
输出：["255.255.11.135","255.255.111.35"]
```

**示例 2：**

```
输入：s = "0000"
输出：["0.0.0.0"]
```

**示例 3：**

```
输入：s = "101023"
输出：["1.0.10.23","1.0.102.3","10.1.0.23","10.10.2.3","101.0.2.3"]
```



**提示：**

- `1 <= s.length <= 20`
- `s` 仅由数字组成

# 2. 题解
# 3. code
```c++
class Solution {
public:
    vector<string> ans;
    bool isValid(string s, int start, int end) {
        if (start > end) return false;
        if (s[start] == '0' && start != end) {
            return false;
        }
        int num = 0;
        for (int i = start; i <= end; i++) {
            if (s[i] < '0' || s[i] > '9') {
                return false;
            }
            num = num * 10 + (s[i] - '0');
            if (num > 255) {
                return false;
            }
        }
        return true;
    }
    void backtracking(string s, int startIdx, int pointNum) {
        if (pointNum == 3) {
            if (isValid(s, startIdx, s.size() - 1)) {
                ans.push_back(s);
            }
            return;
        }
        for (int i = startIdx; i < s.size(); i++) {
            if (isValid(s, startIdx, i)) {
                s.insert(s.begin() + i + 1, '.');
                pointNum++;
                backtracking(s, i + 2, pointNum);
                pointNum--;
                s.erase(s.begin() + i + 1);
            } else {
                break;
            }
        }
        return;
    }
    vector<string> restoreIpAddresses(string s) {
        backtracking(s, 0, 0);
        return ans;
    }
};
```
# 4. 心得

回溯法，注意终止条件，插入点之后，下一层递归的起始位置是i+2，因为插入了一个点。

