**Plotly** 是一个 Python 库，用于设计图形，尤其是交互式图形。它可以绘制各种图形和图表，如直方图、条形图、箱线图、展开图等。它主要用于数据分析以及财务分析。plotly 是一个交互式可视化库。

## 三维表面图

三维表面图是三维数据的表示。它描述了因变量 Y 和两个自变量 X 和 Z 之间的函数关系。该图是等高线图的伴随图。表面图类似于线框图，但线框图的每个面是一个填充的多边形。这有助于表达因变量最高值和最低值所在的位置。

表面图用于:

*   三维数据可视化
*   查看两个因变量和一个自变量之间的关系

### 使用 Plotly 创建三维曲面图

*   **使用 plotly.graph_objects:** 创建三维曲面图
    使用 plotly.graph_objects 模块创建图形跟踪。图形跟踪是 plotly 中名为 graph_objects 的类，用于表示具有各种图形原语(如散点图、线图)的数据。使用 graph_objects 模块创建三维曲面图。图形对象模块包含名为 Surface()的函数。

> **语法:** class plotly.graph_objects。曲面(参数=无，cauto=无，cmax=无，cmin=无，颜色=无，颜色条=无，颜色标度=无，自定义数据=无，自定义数据 src=无，hidesurface=无，hoverinfo=无，hoverinfosrc=无，hoverlabel=无，idssrc=无，图例组=无，light position=无，lighting=无，位置 src=无，名称=无，不透明度=无，反转=无，显示比例=无，显示图例=无，流=无，文本=无，文本 src=无，uid=无，uirevision=无，可见=无，x=无，xsrc=无，y=无，ysrc=无，z=无，zsrc=无，**kwargs)
> 
> **参数:**
> 
> *   **x，y，z:** 设置 x、y 和 z 坐标。每个坐标可以是二维 numpy 数组。如果所有坐标都是一维数组，那么它被解释为值网格的索引。
> *   **颜色:**设置表面颜色。可以是二维数组，也可以是值列表。
> *   **不透明度:**设置该轨迹的不透明度。
> *   **反转:**反转颜色映射。
> *   **显示比例:**显示或隐藏颜色条。
> *   **颜色条:** plotly.graph_objects.surface.ColorBar 的实例或具有兼容属性的字典
> *   **颜色标度:**设置颜色标度。颜色比例是数字和颜色的列表或数组。数字应该在 0 到 1 的范围内。

**示例:**

## 蟒蛇 3

```py
import plotly.graph_objects as go
import numpy as np

# Generate data
x = np.outer(np.linspace(-3, 3, 32), np.ones(32))
y = x.copy().T
z = (np.sin(x **2) + np.cos(y **2) )

# plot the figure
fig = go.Figure(data=[go.Surface(z=z)])

fig.show()
```

