For $s=\sigma+it$, the Riemann zeta series is defined as
$\zeta(s)=\sum_{n=1}^{\infty} n^{-s}$. We can split this into the real and imaginary parts by writing $n^{-s}=e^{-s\log n}=e^{-(\sigma+it)\log n}=e^{-\sigma\log n}e^{-it\log n}=n^{-\sigma}(\cos(t\log n)+i\sin(t\log n))$. So $\zeta(s)=\sum_{n=1}^{\infty}n^{-\sigma}\cos(t\log n)+i\sum_{n=1}^{\infty}n^{-\sigma}\sin(t\log n)$. Since the series is absolutely convergent for $\sigma>1$ (this can be seen by comparison, for $\sigma>1$, with the series $\sum_{n=1}^{\infty}n^{-\sigma}$), and uniformly convergent in any compact subset of the complex half-plane $\sigma>1$, it follows that the series defining $\zeta(s)$ converges for $\sigma>1$, and that $\zeta(s)$ is holomorphic in this half-plane.

We note that the series is not absolutely convergent for $\sigma\leq1$. To see why it converges for $\sigma>1$, we can use an integral test. Compare the terms of the series for $\zeta(s)$ with the terms of the integral $\int_{1}^{\infty}x^{-s}dx$. The integral converges for $\sigma>1$: $\int_{1}^{\infty}x^{-s}dx=\left[\frac{x^{-s+1}}{-s+1}\right]_{1}^{\infty}=\frac{1}{s-1}$ (for $\sigma>1$). So, for $\sigma>1$, the series converges. But it does not converge absolutely for $\sigma=1$, since $\sum_{n=1}^{\infty}|n^{-s}|=\sum_{n=1}^{\infty}n^{-\sigma}$, and the harmonic series diverges. So $\sigma=1$ is the dividing line between convergence and divergence for the series defining $\zeta(s)$.

To show that the series actually does not converge for $\sigma\leq1$, we can use the integral test again. For the integral $\int_{1}^{\infty}x^{-s}dx$ diverges for $\sigma\leq1$, and so the series diverges for $\sigma\leq1$. However, the alternating series $\zeta(s)=\sum_{n=1}^{\infty}n^{-s}$ converges for $\sigma>0$ (this can be seen by Dirichlet's test). So $\sigma=1$ is the only place in the complex plane where the Riemann zeta series is conditionally convergent (for $\sigma>1$ it is absolutely convergent). The series also converges at some points on the line $\sigma=1$; for example, at $s=1+it$ for $t\neq0$ (again by Dirichlet's test). But it does not converge for all $s$ with $\sigma=1$; in particular, it does not converge for $s=1$.
