\section{Introduction}
These are my notes for Calculus I.  They are based on the OpenStax Calculus Volume 1 textbook.  The textbook is available for free at \url{https://openstax.org/details/books/calculus-volume-1}.  These notes are intended to be a supplement to the textbook, not a replacement.  I will try to cover the same material as the textbook, but in a different order and with different examples.  I will also try to include some additional material that I think is important.

\section{Limits}
\subsection{The Idea of a Limit}
The idea of a limit is central to calculus.  It is used to define the derivative and the integral.  The limit of a function $f(x)$ as $x$ approaches $c$ is the value that $f(x)$ approaches as $x$ gets closer and closer to $c$.  We write this as:
\[
\lim_{x \to c} f(x) = L
\]
This means that as $x$ gets closer and closer to $c$, $f(x)$ gets closer and closer to $L$.  Note that $f(x)$ does not have to be defined at $c$ for the limit to exist.  For example, consider the function $f(x) = \frac{x^2 - 1}{x - 1}$.  This function is not defined at $x = 1$, but we can still ask what happens as $x$ approaches 1.  We can factor the numerator:
\[
f(x) = \frac{(x - 1)(x + 1)}{x - 1} = x + 1
\]
for $x \neq 1$.  So as $x$ approaches 1, $f(x)$ approaches 2.  So we say that:
\[
\lim_{x \to 1} f(x) = 2
\]
even though $f(1)$ is undefined.

\subsection{One-Sided Limits}
Sometimes we want to consider what happens as $x$ approaches $c$ from one side or the other.  For example, consider the function $f(x) = \frac{|x|}{x}$.  This function is not defined at $x = 0$, but we can consider what happens as $x$ approaches 0 from the right and from the left.  For $x > 0$, $f(x) = \frac{x}{x} = 1$.  For $x < 0$, $f(x) = \frac{-x}{x} = -1$.  So as $x$ approaches 0 from the right, $f(x)$ approaches 1.  As $x$ approaches 0 from the left, $f(x)$ approaches -1.  We write this as:
\[
\lim_{x \to 0^+} f(x) = 1
\]
and
\[
\lim_{x \to 0^-} f(x) = -1
\]
Since the left-hand limit and the right-hand limit are not equal, we say that the limit as $x$ approaches 0 does not exist.

\subsection{Infinite Limits}
Sometimes as $x$ approaches $c$, $f(x)$ grows without bound.  For example, consider $f(x) = \frac{1}{x}$.  As $x$ approaches 0 from the right, $f(x)$ approaches $\infty$.  As $x$ approaches 0 from the left, $f(x)$ approaches $-\infty$.  We write this as:
\[
\lim_{x \to 0^+} \frac{1}{x} = \infty
\]
and
\[
\lim_{x \to 0^-} \frac{1}{x} = -\infty
\]
Since the left-hand limit and the right-hand limit are not equal (one is $\infty$ and the other is $-\infty$), we say that the limit as $x$ approaches 0 does not exist.  However, we can still describe the behavior of the function near 0.

\subsection{Limit Laws}
There are several laws that allow us to compute limits.  Suppose that $\lim_{x \to c} f(x) = L$ and $\lim_{x \to c} g(x) = M$.  Then:
\begin{enumerate}
\item $\lim_{x \to c} [f(x) + g(x)] = L + M$
\item $\lim_{x \to c} [f(x) - g(x)] = L - M$
\item $\lim_{x \to c} [f(x) g(x)] = L M$
\item $\lim_{x \to c} \frac{f(x)}{g(x)} = \frac{L}{M}$ provided $M \neq 0$
\item $\lim_{x \to c} k f(x) = k L$ for any constant $k$
\item $\lim_{x \to c} [f(x)]^n = L^n$ for any positive integer $n$
\item $\lim_{x \to c} \sqrt[n]{f(x)} = \sqrt[n]{L}$ for any positive integer $n$ (and $L > 0$ if $n$ is even)
\end{enumerate}
These laws allow us to compute limits of complicated functions by breaking them down into simpler parts.

\subsection{The Squeeze Theorem}
The Squeeze Theorem is a useful tool for computing limits.  It says that if $f(x) \leq g(x) \leq h(x)$ for all $x$ near $c$ (except possibly at $c$), and $\lim_{x \to c} f(x) = \lim_{x \to c} h(x) = L$, then $\lim_{x \to c} g(x) = L$.  For example, consider $\lim_{x \to 0} x^2 \sin \frac{1}{x}$.  We know that $-1 \leq \sin \frac{1}{x} \leq 1$, so $-x^2 \leq x^2 \sin \frac{1}{x} \leq x^2$.  As $x$ approaches 0, both $-x^2$ and $x^2$ approach 0, so by the Squeeze Theorem, $\lim_{x \to 0} x^2 \sin \frac{1}{x} = 0$.

\subsection{Continuity}
A function $f(x)$ is continuous at $c$ if $\lim_{x \to c} f(x) = f(c)$.  This means three things:
\begin{enumerate}
\item $f(c)$ is defined
\item $\lim_{x \to c} f(x)$ exists
\item The limit equals the function value
\end{enumerate}
If any of these conditions fail, then the function is discontinuous at $c$.  For example, the function $f(x) = \frac{x^2 - 1}{x - 1}$ is discontinuous at $x = 1$ because $f(1)$ is undefined.  The function $f(x) = \frac{|x|}{x}$ is discontinuous at $x = 0$ because the limit does not exist.  The function $f(x) = \begin{cases} x^2 & \text{if } x \neq 0 \\ 1 & \text{if } x = 0 \end{cases}$ is discontinuous at $x = 0$ because $\lim_{x \to 0} f(x) = 0 \neq 1 = f(0)$.

A function is continuous on an interval if it is continuous at every point in the interval.  Polynomials, rational functions, trigonometric functions, exponential functions, and logarithmic functions are continuous on their domains.

\section{Derivatives}
\subsection{The Derivative as a Limit}
The derivative of a function $f(x)$ at a point $x = a$ is defined as the limit:
\[
f'(a) = \lim_{h \to 0} \frac{f(a + h) - f(a)}{h}
\]
if this limit exists.  Geometrically, this is the slope of the tangent line to the graph of $f$ at the point $(a, f(a))$.  The derivative can also be interpreted as the instantaneous rate of change of $f$ with respect to $x$ at $x = a$.

For example, let $f(x) = x^2$.  Then:
\[
f'(a) = \lim_{h \to 0} \frac{(a + h)^2 - a^2}{h} = \lim_{h \to 0} \frac{a^2 + 2ah + h^2 - a^2}{h} = \lim_{h \to 0} \frac{2ah + h^2}{h} = \lim_{h \to 0} (2a + h) = 2a
\]
So the derivative of $x^2$ is $2x$.

\subsection{Derivative Notation}
There are several notations for the derivative.  If $y = f(x)$, then the derivative can be written as:
\[
f'(x), \quad \frac{dy}{dx}, \quad \frac{d}{dx} f(x), \quad \dot{y} \quad (\text{in physics})
\]
The notation $\frac{dy}{dx}$ is called Leibniz notation.  It is useful because it suggests the definition of the derivative as a limit of difference quotients.

\subsection{Differentiability}
A function is differentiable at $a$ if $f'(a)$ exists.  A function is differentiable on an interval if it is differentiable at every point in the interval.  Differentiability implies continuity: if $f$ is differentiable at $a$, then $f$ is continuous at $a$.  However, continuity does not imply differentiability.  For example, the absolute value function $f(x) = |x|$ is continuous everywhere, but it is not differentiable at $x = 0$ because the left-hand and right-hand derivatives are different.

\subsection{Basic Differentiation Rules}
There are several rules that make it easier to compute derivatives.

\subsubsection{Constant Rule}
If $f(x) = c$ (a constant), then $f'(x) = 0$.

\subsubsection{Power Rule}
If $f(x) = x^n$ for any real number $n$, then $f'(x) = n x^{n-1}$.

\subsubsection{Constant Multiple Rule}
If $f(x) = c g(x)$, then $f'(x) = c g'(x)$.

\subsubsection{Sum Rule}
If $f(x) = g(x) + h(x)$, then $f'(x) = g'(x) + h'(x)$.

\subsubsection{Difference Rule}
If $f(x) = g(x) - h(x)$, then $f'(x) = g'(x) - h'(x)$.

\subsubsection{Product Rule}
If $f(x) = g(x) h(x)$, then $f'(x) = g'(x) h(x) + g(x) h'(x)$.

\subsubsection{Quotient Rule}
If $f(x) = \frac{g(x)}{h(x)}$, then $f'(x) = \frac{g'(x) h(x) - g(x) h'(x)}{[h(x)]^2}$.

\subsubsection{Chain Rule}
If $f(x) = g(h(x))$, then $f'(x) = g'(h(x)) h'(x)$.

\subsection{Derivatives of Trigonometric Functions}
The derivatives of the basic trigonometric functions are:
\begin{align*}
\frac{d}{dx} \sin x &= \cos x \\
\frac{d}{dx} \cos x &= -\sin x \\
\frac{d}{dx} \tan x &= \sec^2 x \\
\frac{d}{dx} \cot x &= -\csc^2 x \\
\frac{d}{dx} \sec x &= \sec x \tan x \\
\frac{d}{dx} \csc x &= -\csc x \cot x
\end{align*}

\subsection{Derivatives of Exponential and Logarithmic Functions}
The derivative of the exponential function $e^x$ is $e^x$.  The derivative of the natural logarithm $\ln x$ is $\frac{1}{x}$.  For other bases:
\begin{align*}
\frac{d}{dx} a^x &= a^x \ln a \\
\frac{d}{dx} \log_a x &= \frac{1}{x \ln a}
\end{align*}

\section{Applications of Derivatives}
\subsection{Related Rates}
Related rates problems involve finding the rate of change of one quantity in terms of the rate of change of another quantity.  The steps are:
\begin{enumerate}
\item Identify the variables and the rates of change.
\item Find an equation relating the variables.
\item Differentiate both sides with respect to time.
\item Substitute known values and solve for the unknown rate.
\end{enumerate}
For example, suppose a ladder 10 ft long is leaning against a wall.  The bottom of the ladder is pulled away from the wall at a rate of 1 ft/s.  How fast is the top of the ladder sliding down the wall when the bottom is 6 ft from the wall?

Let $x$ be the distance from the wall to the bottom of the ladder, and $y$ be the height of the top of the ladder.  Then $x^2 + y^2 = 100$.  Differentiating with respect to $t$:
\[
2x \frac{dx}{dt} + 2y \frac{dy}{dt} = 0
\]
We know $\frac{dx}{dt} = 1$ ft/s, and when $x = 6$, $y = \sqrt{100 - 36} = 8$.  So:
\[
2(6)(1) + 2(8) \frac{dy}{dt} = 0 \implies 12 + 16 \frac{dy}{dt} = 0 \implies \frac{dy}{dt} = -\frac{12}{16} = -\frac{3}{4} \text{ ft/s}
\]
So the top is sliding down at $\frac{3}{4}$ ft/s.

\subsection{Linear Approximation}
The linear approximation of a function $f$ at $a$ is given by:
\[
L(x) = f(a) + f'(a) (x - a)
\]
This is the equation of the tangent line at $a$.  It can be used to approximate $f(x)$ for $x$ near $a$.  For example, to approximate $\sqrt{4.1}$, let $f(x) = \sqrt{x}$, $a = 4$.  Then $f'(x) = \frac{1}{2\sqrt{x}}$, so $f(4) = 2$, $f'(4) = \frac{1}{4}$.  Thus:
\[
L(x) = 2 + \frac{1}{4} (x - 4)
\]
So $\sqrt{4.1} \approx 2 + \frac{1}{4}(0.1) = 2.025$.  The actual value is about 2.0248, so it's a good approximation.

\subsection{Maxima and Minima}
A critical point of a function is a point where the derivative is zero or undefined.  Critical points are candidates for local maxima and minima.

The First Derivative Test: if $f'$ changes from positive to negative at $c$, then $f$ has a local maximum at $c$.  If $f'$ changes from negative to positive at $c$, then $f$ has a local minimum at $c$.

The Second Derivative Test: if $f'(c) = 0$ and $f''(c) > 0$, then $f$ has a local minimum at $c$.  If $f'(c) = 0$ and $f''(c) < 0$, then $f$ has a local maximum at $c$.  If $f''(c) = 0$, the test is inconclusive.

To find absolute maxima and minima on a closed interval $[a,b]$, evaluate $f$ at all critical points in $(a,b)$ and at the endpoints $a$ and $b$, and compare the values.

\subsection{Optimization}
Optimization problems involve finding maximum or minimum values of a function subject to constraints.  The steps are:
\begin{enumerate}
\item Identify the quantity to be optimized and the constraints.
\item Write the quantity as a function of one variable.
\item Find critical points and evaluate the function at critical points and endpoints.
\end{enumerate}
For example, find the dimensions of a rectangle with perimeter 100 ft that has the maximum area.

Let $l$ and $w$ be length and width.  Perimeter $2l + 2w = 100$, so $l + w = 50$, so $w = 50 - l$.  Area $A = l w = l(50 - l) = 50l - l^2$.  Now $A' = 50 - 2l$.  Set to zero: $50 - 2l = 0 \implies l = 25$.  Then $w = 25$.  Second derivative $A'' = -2 < 0$, so maximum.  So the rectangle is a square with side 25 ft.

\subsection{Curve Sketching}
To sketch the graph of a function $f$:
\begin{enumerate}
\item Find the domain and intercepts.
\item Find asymptotes (vertical, horizontal, slant).
\item Find critical points and intervals of increase/decrease.
\item Find local maxima and minima.
\item Find concavity and inflection points.
\item Sketch the curve.
\end{enumerate}

\subsection{L'Hôpital's Rule}
L'Hôpital's Rule is used to evaluate limits of the form $\frac{0}{0}$ or $\frac{\infty}{\infty}$.  It says that if $\lim_{x \to c} f(x) = 0$ and $\lim_{x \to c} g(x) = 0$, or if both limits are $\pm \infty$, and $\lim_{x \to c} \frac{f'(x)}{g'(x)}$ exists, then:
\[
\lim_{x \to c} \frac{f(x)}{g(x)} = \lim_{x \to c} \frac{f'(x)}{g'(x)}
\]
For example, $\lim_{x \to 0} \frac{\sin x}{x} = \lim_{x \to 0} \frac{\cos x}{1} = 1$.

\section{Integrals}
\subsection{Antiderivatives}
An antiderivative of a function $f(x)$ is a function $F(x)$ such that $F'(x) = f(x)$.  The general antiderivative is denoted by $\int f(x)  dx$, and is called the indefinite integral.  For example, $\int x^2  dx = \frac{x^3}{3} + C$, where $C$ is the constant of integration.

\subsection{The Definite Integral}
The definite integral of $f$ from $a$ to $b$ is defined as the limit of Riemann sums:
\[
\int_a^b f(x)  dx = \lim_{n \to \infty} \sum_{i=1}^n f(x_i^*) \Delta x
\]
where $\Delta x = \frac{b - a}{n}$, and $x_i^*$ is a point in the $i$th subinterval.  Geometrically, it represents the net area between the graph of $f$ and the x-axis from $a$ to $b$.

\subsection{The Fundamental Theorem of Calculus}
The Fundamental Theorem of Calculus connects differentiation and integration.

Part 1: If $f$ is continuous on $[a,b]$, and $F(x) = \int_a^x f(t)  dt$, then $F'(x) = f(x)$.

Part 2: If $f$ is continuous on $[a,b]$, and $F$ is any antiderivative of $f$, then:
\[
\int_a^b f(x)  dx = F(b) - F(a)
\]
This is often written as $F(b) - F(a) = \left[ F(x) \right]_a^b$.

\subsection{Integration Techniques}
\subsubsection{Substitution}
Substitution is the reverse of the chain rule.  If $u = g(x)$, then:
\[
\int f(g(x)) g'(x)  dx = \int f(u)  du
\]
For definite integrals:
\[
\int_a^b f(g(x)) g'(x)  dx = \int_{g(a)}^{g(b)} f(u)  du
\]

\subsubsection{Integration by Parts}
Integration by parts is the reverse of the product rule.  It says that:
\[
\int u  dv = u v - \int v  du
\]
A common choice is LIATE: Logarithmic, Inverse trigonometric, Algebraic, Trigonometric, Exponential.  Choose $u$ to be the function that comes first in LIATE.

\subsubsection{Trigonometric Integrals}
For integrals involving products of sines and cosines, use trigonometric identities to simplify.  For example:
\begin{itemize}
\item $\int \sin^m x \cos^n x  dx$: if $m$ or $n$ is odd, use substitution; if both even, use half-angle formulas.
\item $\int \tan^m x \sec^n x  dx$: similar strategies.
\end{itemize}

\subsubsection{Trigonometric Substitution}
Trigonometric substitution is useful for integrals involving $\sqrt{a^2 - x^2}$, $\sqrt{a^2 + x^2}$, $\sqrt{x^2 - a^2}$.
\begin{itemize}
\item For $\sqrt{a^2 - x^2}$, use $x = a \sin \theta$.
\item For $\sqrt{a^2 + x^2}$, use $x = a \tan \theta$.
\item For $\sqrt{x^2 - a^2}$, use $x = a \sec \theta$.
\end{itemize}

\subsubsection{Partial Fractions}
Partial fractions are used to integrate rational functions.  Factor the denominator, and write the fraction as a sum of partial fractions.  Then integrate each term.

\subsection{Applications of Integration}
\subsubsection{Area Between Curves}
The area between two curves $y = f(x)$ and $y = g(x)$ from $x = a$ to $x = b$ is:
\[
\int_a^b |f(x) - g(x)|  dx
\]
In practice, find where the curves intersect to determine the limits, and integrate the difference.

\subsubsection{Volume}
The volume of a solid of revolution can be found by disks, washers, or shells.

Disk method: if rotating around the x-axis, $V = \int_a^b \pi [f(x)]^2  dx$.

Washer method: if rotating around the x-axis with a hole, $V = \int_a^b \pi ([R(x)]^2 - [r(x)]^2)  dx$.

Shell method: if rotating around the y-axis, $V = \int_a^b 2\pi x f(x)  dx$.

\subsubsection{Arc Length}
The arc length of a curve $y = f(x)$ from $x = a$ to $x = b$ is:
\[
\int_a^b \sqrt{1 + [f'(x)]^2}  dx
\]

\subsubsection{Surface Area}
The surface area of a surface of revolution is:
\[
\int_a^b 2\pi f(x) \sqrt{1 + [f'(x)]^2}  dx \quad \text{(around x-axis)}
\]

\section{Conclusion}
This covers the main topics of Calculus I.  There is much more to learn, but this should give a good foundation.  Practice is essential for mastering calculus, so work through many problems.

